
// Wird ausgeführt sobald die Website fertig geladen hat.
$(document).ready(function() {
    $("#signature").jSignature()
    resetCanvas();
})

// Entfernt den Signaturstrich und auch bereits gemalte striche.
// Funktion wird nach dem Ladevorgang der Website ausgeführt sowie beim drücken des "Zurücksetzen" knopfes
const resetCanvas = () =>{
    $("#signature").jSignature("importData","data:image/jpeg;base64,")
}

// Der Button "Download" führt die Funktion aus wenn er geklickt wird.
const exportCanvas = () => {
    var data = $('#signature').jSignature('getData', 'default') //Verschlüsselt das Bild als base64
    var a = document.createElement("a"); //Erstelle <a>
    a.href = data; //das base64 verschlüsselte Bild
    a.download = "Image.png"; //Name der Datei die heruntergeladen wird
    a.click(); //Downloaded Datei
}